import React from 'react';

class Blank extends React.Component {
    render() {
        return(
            <div>
                <section
                    data-background-color='rgb(32, 202, 172)'
                    className='js-color-stop'
                    >
                        Some content
                        </section>
            </div>
        );
    }
}

export default Blank;
